import React, { Component } from 'react';
import {
  Nav, Navbar, NavItem, MenuItem, NavDropdown,
} from 'react-bootstrap';
class NavbarHeader extends Component {
  render() {
    return (
      <Navbar inverse>
        <Navbar.Header>
          <Navbar.Brand>
            <a href="#home"><b>Student's Club</b></a>
          </Navbar.Brand>
        </Navbar.Header>
      </Navbar>
    );
  }
}

export default NavbarHeader;
